INSERT INTO `articles` (`id`, `name`, `slug`, `description`, `avatar`, `status`, `hot`, `menu_id`, `user_id`, `content`, `created_at`, `updated_at`) VALUES
(3, 'DOJI TẶNG HÀNG NGÀN E-VOUCHER MỪNG SINH NHẬT KHÁCH HÀNG THÁNG 1.2024', 'doji-tang-hang-ngan-e-voucher-mung-sinh-nhat-khach-hang-thang-12024', 'Mong muốn gửi lời tri ân đặc biệt đến khách hàng nhân ngày sinh nhật và mang lại những quyền lợi tốt nhất khi khách hàng trải nghiệm mua sắm các sản phẩm đẳng cấp', '2024-01-16__ecard.jpg', -1, 0, 3, 3, '<p><i><strong>OJI dành tặng 03 mã E-voucher có giá trị lên tới 2 triệu đồng cho các khách hàng có sinh nhật trong tháng 1.2024 để mua sắm tại các Trung tâm Vàng bạc Trang sức DOJI trên toàn quốc.</strong></i></p><p>Ngoài ưu đãi nhận E-voucher, khách hàng còn nhận được:&nbsp;</p><p>- Tặng thêm 5% khi sử dụng dịch vụ nhà hàng Jade Moon.</p><p>- Tặng thêm 15% tiền phòng và 5% tiền dịch vụ ăn uống tại khách sạn Best Western Premier Sapphire Hạ Long.</p><p>(Áp dụng chung cùng ưu đãi thẻ DOJI Elite Club).</p><p>Khách hàng chỉ cần cung cấp SĐT và màn hình tin nhắn Chúc mừng sinh nhật Tháng 1 từ Brandname DOJI GROUP cho Tư vấn viên/ Trưởng quầy/ Phó quầy tại điểm bán để hưởng ưu đãi.</p><p>Quý khách hàng tìm hiểu thêm các quy định áp dụng của E-voucher để thuận tiện trong sử dụng, cụ thể như sau:</p><p><strong>2. Quy định áp dụng E-voucher:</strong></p><p>- Được áp dụng song song với các Chương trình Khuyến mại hiện hành; Áp dụng Chương trình Khuyến mại trước khi áp dụng E-voucher.</p><p>- E-voucher áp dụng cho 01 đôi hoa tai, 01 cặp nhẫn cưới (Không áp dụng cho 1 chiếc).</p><p>- E-voucher không áp dụng đồng thời với các loại Voucher/ E-voucher khác (Trừ TPBank, SUN LIFE, TPS, VINA, DAPHARCO, PEPSI, URBOX, KMS, TOTO).</p><p>- E-voucher không áp dụng với các sản phẩm list đặc biệt.</p><p>- E-voucher được áp dụng cộng gộp hóa đơn các sản phẩm trang sức có trong quy định và được sử dụng một lần duy nhất.</p><p>- Được áp dụng cho đơn hàng trả góp/Đơn hàng đặt cọc trước khi nhận được E-voucher.</p><p>- Khách hàng có ưu đãi thẻ hội viên Diamond Elite/ Platinum Elite/ Gold Elite/ Silver Elite: Chỉ được áp dụng 1 trong 2 ưu đãi: CTKM hiện hành/ Ưu đãi thẻ hội viên cùng với ưu đãi E-voucher. TVV chọn mức chiết khấu cao nhất cho Khách hàng.</p><p>- E-voucher không có giá trị quy đổi ra tiền mặt.</p><p>- E-voucher có thể được chuyển nhượng cho người thân, bạn bè.</p><p>- E-voucher có thời hạn sử dụng trong vòng 02 tháng (01.01.2024 – 29.02.2024)</p><p><strong>Để biết thêm thông tin chi tiết chương trình, Quý khách vui lòng gọi Hotline (Miễn phí): 1800 1168.</strong></p>', '2024-04-28 05:29:48', '2024-04-28 05:29:48'),
(4, 'Cùng DOJI bừng sắc diện, kết tình thân dịp tết Giáp Thìn', 'cung-doji-bung-sac-dien-ket-tinh-than-dip-tet-giap-thin', 'Để xuân này thêm trọn vẹn và gắn kết, quà Tết gửi tặng người thân không gì tuyệt vời hơn là trang sức sang trọng và quà tặng vàng giá trị, vừa giúp bừng sắc diện vừa mang lời chúc về một năm mới tỏa sáng và thịnh vượng.', '2024-01-16__pr1-1-dxbsb2fkymfubmvymjayndaxchvzahnhbgu-medium.jpg', 1, 0, 3, 3, '<p>Năm hết Tết đến luôn là khoảnh khắc để mỗi người sống chậm lại và gia tăng gắn kết tình thân. Thấu hiểu điều này, DOJI mang đến chương trình ưu đãi đón xuân Giáp Thìn “Mùa Tết – Mùa của tình thân” với ưu đãi lên đến 300 triệu đồng.&nbsp;</p><figure class=\"image\"><img style=\"aspect-ratio:3000/2000;\" src=\"http://localhost:8000/media/anh 2_1705421252.jpeg\" width=\"3000\" height=\"2000\"></figure><p>Theo đó, từ ngày 15/1 đến ngày 05/2/2024, DOJI dành tặng ưu đãi tới 300 triệu đồng khi mua kim cương viên; tặng đến 10 triệu đồng khi mua trang sức cao cấp; giảm tới: 10% khi mua trang sức Vàng 24K, 13% khi mua quà tặng Vàng Kim Bảo Phúc và 35% đồng hồ.</p>', '2024-04-28 05:29:48', '2024-04-28 05:29:48'),
(6, 'Trang sức DOJI tung siêu bão ưu đãi tới 40% tại Hội chợ VIJF 2023', 'trang-suc-doji-tung-sieu-bao-uu-dai-toi-40-tai-hoi-cho-vijf-2023', 'Trang sức DOJI tung ‘siêu’ ưu đãi tới 40%, trang sức giá 0 đồng… cùng hàng ngàn quà tặng hấp dẫn khác tại Hội chợ Quốc tế Trang sức Việt Nam – VIJF 2023.', '2024-01-16__1a.jpg', 1, 0, 4, 11, '<p>Nối tiếp thành công rực rỡ của các kỳ hội chợ trước đó, Trang sức DOJI tiếp tục tham gia VIJF 2023 với quy mô gian hàng hoành tráng, ưu đãi đặc biệt cùng hàng ngàn quà tặng giá trị từ ngày 16/11 – 19/11/2023.</p><p>Dịp này, Trang sức DOJI triển khai chương trình “Đón siêu bão giá – Quà chất liền tay” siêu hấp dẫn dành riêng cho khách hàng ghé thăm và mua sắm trực tiếp tại Hội chợ:&nbsp;</p><p>-&nbsp;Ưu đãi trang sức tới 40%&nbsp;</p><p>-&nbsp;Cơ hội mua trang sức với giá 0 đồng</p><p>-&nbsp;Ưu đãi tới 15% kim cương viên và tặng kim cương tới 6.3mm (áp dụng có điều kiện)&nbsp;</p><p>-&nbsp;Ưu đãi nhẫn cưới, nhẫn đính hôn 20% và tặng thêm nhẫn hồi môn 24K khi mua combo cưới</p><p>-&nbsp;Giảm ngay tới 150 nghìn đồng/lượng khi mua vàng ép vỉ (không áp dụng SJC)</p><figure class=\"image\"><img style=\"aspect-ratio:2000/1334;\" src=\"http://localhost:8000/media/anh bai viet 3_1705422838.jpeg\" width=\"2000\" height=\"1334\"></figure><p>Trang sức DOJI mang đến Hội chợ VIJF 2023 hàng trăm thiết kế trang sức độc đáo, dẫn đầu xu hướng. Mỗi tuyệt tác trang sức không chỉ thu hút bởi vẻ đẹp tinh xảo, sang trọng mà còn giúp tôn vinh phong cách thời thượng của chủ nhân.</p>', '2024-04-28 05:29:48', '2024-04-28 05:29:48');
