(2, 'Chính sách bảo hành', 'Mô tả chính sách bảo hành', '<h4>Kiểm tra tổng thể bên ngoài</h4><p><strong>Kiểm tra hộp đựng</strong></p><p>Mỗi chiếc laptop đều được đựng trong những chiếc hộp có dán seal chắc chắn, an toàn để đảm bảo chất lượng sản phẩm. Người dùng cần kiểm tra xem seal có còn nguyên vẹn hay không, hộp đựng có tình trạng móp méo, rách, hở, lồi lõm hoặc in ấn sơ sài hay không để tránh tình trạng mua phải hàng kém chất lượng.</p><p>nội dung mới update&nbsp;</p>', NULL, '/chinh-sach-bao-hanh', NULL, '2024-04-28 05:29:48', '2024-04-28 05:29:48');
