(1, 'Premium sandal-leather cordless men\'s shoes', 'premium-sandal-leather-cordless-mens-shoes', 'Giày tây nam không dây da trơn cao cấp', '2024-06-11__1.webp', 2, 0, 0, 12, 14, 3, NULL, NULL, 4, 1700000, 100, 6, 0, 11, 'Giày tây nam không dây da trơn cao cấp GNLA8878-612-D', '2024-04-28 05:47:09', '2024-06-11 06:32:00', 4),
(2, 'Oxford style men\'s leather shoes', 'oxford-style-mens-leather-shoes', 'Giày da nam kiểu dáng Oxford lịch lãm GNLAAZ01-1-D', '2024-06-11__2.webp', 2, 0, 0, 9, 5, 1, NULL, NULL, NULL, 1800000, 100, 3, 0, 11, 'Giày da nam kiểu dáng Oxford lịch lãm GNLAAZ01-1-D', '2024-04-28 06:57:08', '2024-06-16 01:59:15', 4),
(4, 'CLUBMAN DERBY - DB24', 'clubman-derby-db24', 'CLUBMAN DERBY - DB24', '2024-05-27__z5143317784039-b240d3effacde7daea6355bdbab40821.webp', 1, 0, 0, 15, 0, 0, NULL, NULL, NULL, 2100000, 136, 0, 0, 11, 'Ra đời vào đầu năm 2024, Clubman Derby là một trong những đôi giày Derby nam đẹp nhất đang có mặt tại Be Classy từ trước đến nay.\r\n\r\nVới sự phóng khoáng và bụi bặm trong thiết kế lẫn chất liệu, Be Classy tin chắc rằng đôi giày Derby này sẽ là món phụ kiện hoàn hảo để tạo nên một phong cách thật ấn tượng và hiện đại.', '2024-05-26 20:30:52', '2024-06-11 06:27:19', 4),
(5, 'CLUBMAN CHELSEA BOOTS - BO01', 'clubman-chelsea-boots-bo01', 'CLUBMAN CHELSEA BOOTS - BO01', '2024-05-28__z5010900617271-c1000c7338ab65137fb11311c7161f87.webp', 2, 0, 0, 15, 19, 4, NULL, NULL, NULL, 2350000, 167, 3, 0, 11, 'Ra đời vào đầu năm 2024, Clubman Chelsea Boots là một trong những đôi Boots nam đẹp nhất tại Be Classy từ trước đến nay.\r\n\r\nMang vẻ thanh lịch, cổ diển của dòng Chelsea Boots huyền thoại, cùng với đó là phần đế cao 4cm cao hơn 1cm khác biệt hoàn toàn với các thiết kế trước đây, Be Classy tin chắc rằng Clubman Chelsea Boots sẽ là món phụ kiện hoàn hảo để tạo nên một phong cách thật phóng khoáng và hiện đại.', '2024-05-27 23:24:31', '2024-06-12 05:28:57', 4),
(6, 'CLUBMAN COMBAT BOOTS - BO02', 'clubman-combat-boots-bo02', 'CLUBMAN COMBAT BOOTS - BO02', '2024-05-28__dscf7715-5da8ecf5-c0bf-4eac-b12b-bfbafd9ea7ea.webp', 2, 0, 0, 15, 0, 0, NULL, NULL, NULL, 2350000, 69, 0, 0, 11, 'Ra đời vào đầu năm 2024, Clubman Combat Boots là một trong những đôi Boots nam đẹp nhất tại Be Classy từ trước đến nay.\r\n\r\nVới sự phóng khoáng và bụi bặm trong thiết kế lẫn chất liệu, Be Classy tin chắc rằng Clubman Combat Boots sẽ là món phụ kiện hoàn hảo để tạo nên một phong cách thật ấn tượng và hiện đại.', '2024-05-27 23:27:44', '2024-05-27 23:27:44', 4),
(7, 'BOLD STEP LOAFER - LF05', 'bold-step-loafer-lf05', 'BOLD STEP LOAFER - LF05', '2024-05-28__bold-step-loafer-lf05-den.jpg', 2, 0, 0, 10, 0, 0, NULL, NULL, NULL, 1850000, 99, 0, 0, 11, 'BOLD STEP LOAFER là mẫu Loafer nam lạ mắt với thiết kế phối da độc đáo, khác biệt nhất từ trước đến giờ của Be Classy. Chất liệu được chế tác hoàn toàn từ da Bò Ý cao cấp, bền bỉ và sang trọng, đường may vô cùng chắc chắn tạo nên những bước di chuyển vô cùng tự tin. \r\n\r\nMàu sắc chính: đen - nâu - nâu sáng - xanh navy - xanh rêu.', '2024-05-27 23:31:36', '2024-05-27 23:31:36', 4),
(8, 'NEWGEN TASSEL LOAFER - LF04', 'newgen-tassel-loafer-lf04', 'NEWGEN TASSEL LOAFER - LF04', '2024-05-28__newgen-tassel-loafer-lf04.webp', 2, 0, 0, 10, 0, 0, NULL, NULL, NULL, 1850000, 245, 0, 0, 11, 'NEWGEN TASSEL LOAFER - LF04', '2024-05-27 23:35:56', '2024-05-27 23:35:56', 4),
(9, 'CLASSY DOUBLE MONKSTRAP - MS04S', 'classy-double-monkstrap-ms04s', 'CLASSY DOUBLE MONKSTRAP - MS04S', '2024-05-28__classy-double-monkstrap-ms04s.webp', 2, 0, 0, 10, 5, 1, NULL, NULL, NULL, 1750000, 139, 1, 0, 11, 'Dành cho những quý ông yêu thích phong cách Formal, thiết kế của CLASSY MONKSTRAP xưa nay đều nổi bật bởi vì khóa cài đặc trưng, bật lên sự sang trọng của nó. \r\n\r\nChất liệu da thật như thế này sẽ là một điểm đặc biệt giúp cho bạn dễ dàng phối trang phục hơn rất nhiều. Đôi monkstrap sẽ là lựa chọn phù hợp dành cho những quý ông công sở.', '2024-05-27 23:39:26', '2024-06-11 06:17:28', 4),
(10, 'GIBSON PENNY LOAFER - LFF08', 'gibson-penny-loafer-lff08', 'GIBSON PENNY LOAFER - LFF08', '2024-05-28__gibson-penny-loafer-lff08.webp', 2, 0, 0, 10, 10, 2, NULL, NULL, NULL, 2350000, 99, 2, 0, 11, 'GIBSON PENNY LOAFER - đôi giày Loafer đế da sang trọng và dành cho những Quý Ông thích sự lịch lãm với những bộ Suit. Nếu như yêu thích dòng Loafer sang trọng, đây hẳn là đôi giày mà bạn không thể thiếu trong tủ giày.', '2024-05-27 23:42:31', '2024-06-09 19:41:34', 4),
(11, 'CLASSY DOUBLE MONKSTRAP - MS04', 'classy-double-monkstrap-ms04', 'CLASSY DOUBLE MONKSTRAP - MS04', '2024-05-28__classy-double-monkstrap-ms04.webp', 2, 0, 0, 10, 0, 0, NULL, NULL, NULL, 3500000, 86, 1, 0, 11, 'Mang trong mình chất cổ điển rất riêng của giày da Be Classy nhưng Double Monkstrap lại được \"thổi\" vào một màu sắc mới trong phom dáng. Quý Ông có thể thấy đôi Monktrap lần này có sự khác biệt với phần mũi vuông mang sự sang trọng hơn, vô cùng tiện lợi để di chuyển cùng như kết hợp dễ dàng với bất kỳ trang phục nào.', '2024-05-27 23:47:18', '2024-05-28 06:33:49', 4),
(12, 'GIBSON CHELSEA BOOTS - DO01', 'gibson-chelsea-boots-do01', 'GIBSON CHELSEA BOOTS - DO01', '2024-05-29__gibson-chelsea-boots-do01.webp', 2, 0, 0, 15, 9, 2, NULL, NULL, NULL, 2900000, 888, 1, 0, 11, 'GIÀY BOOTS - GIBSON CHELSEA BOOTS - DO01 - Be Classy\r\n\r\nMang thiết kế đơn giản dễ phối đồ, dòng Boots mới của Be Classy được đa số các Quý Ông đón nhận.', '2024-05-29 08:48:57', '2024-06-09 19:42:14', 4),
(13, 'CLASSY CHELSEA BOOTS - BO14S', 'classy-chelsea-boots-bo14s', 'CLASSY CHELSEA BOOTS - BO14S', '2024-05-29__classy-chelsea-boots-bo14s.webp', 2, 0, 0, 15, 15, 3, NULL, NULL, NULL, 1985000, 94, 1, 0, 11, 'Là mẫu giày Boots da lộn cổ điển, Classy Chelsea Boots là một trong những đôi Boots nam đẹp nhất tại Be Classy từ trước đến nay.\r\n\r\nMang vẻ hiện đại và thanh lịch của dòng Chelsea Boots huyền thoại, cùng với đó là phom dáng mũi nhọn thời thượng, tôn chân, Be Classy tin chắc rằng Classy Chelsea Boots sẽ là món phụ kiện hoàn hảo để tạo nên một phong cách thật phóng khoáng và hiện đại.', '2024-05-29 08:53:53', '2024-06-11 06:27:19', 4),
(14, 'SIR CLASSIC DERBY - DB07', 'sir-classic-derby-db07', 'SIR CLASSIC DERBY - DB07', '2024-05-29__sir-classic-derby-db07.webp', 2, 0, 0, 12, 0, 0, NULL, NULL, NULL, 3600000, 84, 0, 0, 11, 'Luôn được biết đến là một trong những mẫu giày \"quốc dân\" của các Quý ông, Sir Classic Derby sở hữu cho mình thiết kế cổ điển với gam màu tối giản giúp dễ dàng kết hợp với nhiều trang phục khác nhau, từ suit lịch lãm cho đến jeans năng động.\r\n\r\nChất liệu từ da Bò Ý với đế cao su bền bỉ và chắc chắn, cho những bước đi linh hoạt và chắc chắn, góp phần tạo nên hình tượng chuẩn một Quý Ông.', '2024-05-29 09:09:26', '2024-06-11 06:27:19', 4),
(15, 'THE COUNTRYMAN DERBY - DB14', 'the-countryman-derby-db14', 'THE COUNTRYMAN DERBY - DB14', '2024-05-29__the-countryman-derby-db14.webp', 2, 0, 0, 12, 0, 0, NULL, NULL, NULL, 3250000, 61, 0, 0, 11, 'THE COUNTRYMAN DERBY - DB14', '2024-05-29 09:12:45', '2024-06-11 06:27:19', 4),
(16, 'THE NEWGEN DERBY - DB01', 'the-newgen-derby-db01', 'THE NEWGEN DERBY - DB01', '2024-05-29__dscf6077the-newgen-derby-db01.webp', 2, 0, 0, 12, 0, 0, NULL, NULL, NULL, 2560000, 99, 0, 0, 11, 'THE NEWGEN DERBY - DB01', '2024-05-29 09:16:41', '2024-06-16 02:01:50', 4);
